import React from 'react';
import {AppBar, Toolbar, Typography, Grid, Button} from '@material-ui/core';
import { makeStyles, ThemeProvider} from '@material-ui/core/styles';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import loginButton from ''

const Header = () => {

    const navBar = makeStyles({
        title: {
            marginRight: "1110px"
        },
        loginButton: {
            fontSize: "14",
            fontFamily: "IBM plex sans",
            marginRight: "15px",
            variant: "outlined"
        },
        signUpButton: {

            backgroundColor: "#3485E4",
            marginRight: "2px"
        }
    });

    const classes = navBar();

    return(
        <AppBar boxShadow={3} position="static" width="100%" style={{ margin: 0 }}>
                <Toolbar>
                        <AccountCircleIcon />
                        <Typography className={classes.title} variant='h6'>StarCipher</Typography>
                        <Button 
                            className={classes.loginButton} 
                            style={{backgroundColor: "#262B3B", color: "#3485E4"}}
                            boxShadow={3} 
                            onMouseEnter={event=>{
                                event.target.style.backgroundColor = "#3485E4" 
                                event.target.style.color = "white"
                            }}
                            onMouseLeave={event=>{
                                event.target.style.backgroundColor = "#262B3B"
                                event.target.style.color = "#3485E4"
                            }}
                            >Log in</Button>
                        <Button className={classes.signUpButton} boxShadow={3}>Sign up</Button>
                </Toolbar>
        </AppBar>
    );
}

export default Header;
